sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new GoogleDirectoryUtils();
    inputs.user_key = utils.trimStringInputs([inputs
        .user_key
    ]);
    if (utils.isEmpty(inputs.user_key))
        throw new Error("User key cannot be empty");
    outputs.user_key = inputs.user_key;
    var payload = {
        status: false
    };
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

